Plug the numbers into the formula for rate of change and simplify.
Rate of change
 = \frac{change in value}{change in time}
 = \frac{$31 - $30}{2008 - 2007}
 = \frac{$31 - $30}{1 year}
 = \frac{$1}{1 year}
 = $1 per year
The rate of change between 2007 and 2008 was $1 per year.

Plug the numbers into the formula for rate of change and simplify.
Rate of change
 = \frac{change in value}{change in time}
 = \frac{12 kilograms - 18 kilograms}{2015 - 2014}
 = \frac{12 kilograms - 18 kilograms}{1 year}
 = \frac{-6 kilograms}{1 year}
 = -6 kilograms per year
The rate of change between 2014 and 2015 was - 6 kilograms per year.
